var tipuesearch = {"pages": [{'title': '各組期末報告說明', 'text': '各組員必須在 W17 上課之前完成期末報告簡報影片上傳與連結, 並放入本網站之"專案口頭簡報"頁面. \n 各組必須在 W17 上課之前完成分組期末報告 pdf 檔案, 上傳至各分組的倉儲中, 並將連結提供至本網站之"專案報告書"頁面. \n 期末報告期間每週對各成員之評分依據下列要項: \n \n 各組員在各分組網站中所呈現之任務執行內容, 並拍攝操作影音 mp4, 將影片標題署名"國立虎尾科技大學-機械設計工程系-協同產品設計實習 A - 學號及影片主題" 後上傳, 並將影片嵌入本網站各章節頁面中. \n 每組將提供組長本網站倉儲協同管理權, 專門處理各組員在各分支或 master 分支中的 pull requests, 各組員必須透過以 ag1, ag2 .... 命名之分支對本倉儲改版, 確定內容無誤後, 再設法由組長處理各 pull requests 之內容合併, Github Pages 將設為與 master 分支對應, 各組員之評分將依據各 pull requests 中所列出之學號與內容判定. \n 請各組員勿將影片檔、圖片檔案或各式檔案送至本倉儲, 影片檔案請上傳至 Youtube, 圖片檔案請送至各組倉儲網站, 各式檔案則請送至各組員 Google Drive 區, 並以嵌入 (iframe), 將影片放入本網站, 其餘圖片或檔案則透過 img 或 a 標註放入各相關頁面. \n \n 2a 分組倉儲 \n https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g1 \xa0( 2ag1 ) https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g2 \xa0( 2ag2 ) https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g3_1 \xa0( 2ag3 ) https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g4 \xa0( 2ag4 ) https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g5 \xa0( 2ag5 ) https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g6 \xa0( 2ag6 ) \n \n', 'tags': '', 'url': '各組期末報告說明.html'}, {'title': '執行規劃', 'text': '', 'tags': '', 'url': '執行規劃.html'}, {'title': '手足球系統模擬', 'text': '組長: \n 40623134 紀冠瑋 \n 組員: \n 40623153 廖祥佑、40423111 吳承翰 \n 40623138 黃柏諺、40623154 黃馨慧 \n 40423214 李奇軒、40623131 周紹叡 \n 40623114 吳信億、40423159 張惟珉 \n 40423142 黃興煜 \n 專案執行內容 \n 零組件尺寸分析 (40623154 ) \n 手足球系統模擬 (40423214 、40623138 ) \n 參數設計與繪圖 (40623154 ) \n 送球機構設計與模擬 ( 40623134、40423214) \n \n 專案成果摘要 \n 專案執行動機 \n 相關文獻探討 \n 執行使用套件 \n V-rep \n 專案執行過程規劃 \n 專案結論 \n', 'tags': '', 'url': '手足球系統模擬.html'}, {'title': '設計與繪圖', 'text': '', 'tags': '', 'url': '設計與繪圖.html'}, {'title': '零組件尺寸分析', 'text': '1.球桌 \n 我們是參考火球國際公開賽桌球場的規格做基準，基本上對尺寸做了一點微調。 \n 球桌剛成形.jpg \n 增加為了讓回球機構能運作的平面，且球門前的球員行程並沒有想像中的寬，故在角落處增加圓弧面。 \n 球桌完成.jpg \n 2.球員 \n 外型依照老師提供的造型作為使用，我們將孔洞放大便於組合與安裝。 \n 球員.jpg \n 3.球桿 \n 參考火球國際公開賽桌將球桿分為一、二、三、五人，桿上突起部位為安裝球員處。 \n 單人、雙人桿在末端都向外延伸了一個10mm的圓柱，用來限制球員的行程和防止球桿從孔洞掉落。 \n 單人桿.jpg \xa0、  雙人桿.jpg \n 三人、五人桿因為安裝球員處的圓柱能達到限制形成的效果，所以並沒有向外延伸圓柱。 \n 三人桿,jpg  、  五人桿.jpg \n 4.圓盤 \n 這是剛開始使用的回球機構的圓盤。 \n 舊圓盤,jpg \xa0、  舊圓盤剖面.jpg \n 因為球會卡在球道末端而修改了錐形孔的圓心位置和圓盤大小及厚度。 \n 新圓盤.jpg \xa0、 新圓盤剖面.jpg \n 5.握把 \n 依照火球國際公開賽桌的握把去抓尺寸而繪製的樣子，但我們並沒有繪製銷孔和銷，只是單純利用塑膠可壓縮性而配合上去的。 \n 握把.jpg \n 6.球道 \n 剛開始設計出來的球道模型。 \n 舊球道.jpg \n 球道的入口處因球道入口處太小，有機會進不了入口或彈出，因為入口處地板是平面所以球有機會停在此處。 \n 舊球道入口.jpg \n 出口處平面部分過長，球有機會停置於此處。 \n 舊球道出口.jpg \n 修改後的整體圖 \n 新球道.jpg \n 修改後的入口處地板採用斜面、且入口增大，解決了入口卡球的問題。 \n 新球道入口.jpg \n 出口修改為斜面到底，且增加圓弧面更容易讓球滾入圓盤。 \n 新球道出口.jpg \n 7.套筒 \n 為了讓球桿方便安裝，原本的孔洞與球桿設定為直徑15mm，但桿上的球員安裝處為直徑20mm，故將球桌的孔洞從15mm改為20mm，使球桿穿過孔洞之後安裝套筒就能使球桿固定於孔上也不會有安裝不便的問題。 \n 套筒.jpg \n', 'tags': '', 'url': '零組件尺寸分析.html'}, {'title': '參數設計與繪圖', 'text': '手足球系統的零組件參數設計與繪圖 (零組件初步設計繪圖) \n Onshape 零組件連結 \n', 'tags': '', 'url': '參數設計與繪圖.html'}, {'title': '細部設計與 BOM', 'text': '手足球零件格式說明 \n 手足球零件格式說明 \n 零件 BOM \n 手足球零組件材料表 (含零組件下載連結) \n 零件尺寸圖 \n 零件尺寸圖 \n 零件部分組裝圖 \n 零件部分組裝圖 \n 3D 零組件爆炸圖 \n 3D 零組件爆炸圖 \n', 'tags': '', 'url': '細部設計與 BOM.html'}, {'title': 'V-rep 動態模擬', 'text': '\n', 'tags': '', 'url': 'V-rep 動態模擬.html'}, {'title': '送球機構設計與模擬', 'text': '雙邊進球 \n \n \n', 'tags': '', 'url': '送球機構設計與模擬.html'}, {'title': '系統功能展示', 'text': '手足球模擬系統功能展示 (模擬展示與說明影片) \n \n', 'tags': '', 'url': '系統功能展示.html'}, {'title': '結案報告', 'text': '', 'tags': '', 'url': '結案報告.html'}, {'title': '專案口頭簡報', 'text': '各組利用倉儲中的 Reveal.js 進行結案簡報 (結案口頭簡報) \n', 'tags': '', 'url': '專案口頭簡報.html'}, {'title': '專案報告書', 'text': '各組完成 html 與 pdf 格式之手足球專案結案報告 (文字結案報告書)', 'tags': '', 'url': '專案報告書.html'}]};
